import React from 'react'
import MealCard from '../MealCard';
import './styles.css';
function MealsContainer  ({meals}) {
  return (
    <div className="meals-containter">
    {meals?.map((meal,idMeal)=>(
    <div key={meal.idMeal}> 
          <MealCard {...meal}/>
    </div>

))};
   
    </div>
  )
}
export default MealsContainer;
